import Auth from "./Auth";

export default function Landing() {
    return (
        <div className="landing">
            <div className="tired">
                Tired of the mess that binance passes off as order history ?
            </div>
            <button className="question">Yes</button>
            <button className="question">No</button>
            <div className="lucky">
                Well if that is the case, this is your lucky day! In this
                website you have the superpower to convert the boring and
                troubeling excel sheet in statistics for humans
            </div>
            <button className="getstarted">Get started!</button>
        </div>
    );
}
